import React, {Component} from 'react';
import {Row, Col,Container} from 'react-bootstrap';
import {Hasil, ListCategories, NavbarComponent} from './components';
import {API_URL} from './utils/contants'
import axios from 'axios'

export default class App extends Component {
  constructor(props) {
    super(props)

    this.state = {
       menus : [],
    }
  }

  componentDidMount(){
    axios
    .get(API_URL+"barangs")
    .then(res => {
      console.log(res)
      const menus = res.data;
      this.setState({ menus });
    })
    .catch(error =>{
    console.log(error)
    })
  }

  render() {
    const {menus} = this.state
    return (
      <div className="App">
      <NavbarComponent/>
      <div className="mt-4">
         <Container fluid>
             <Row>
               <ListCategories/>
                   <Col>
                       <h4><strong>Barang</strong></h4>
                       <hr/>
                          <Row>
                            {menus && menus.map((menu) => (
                              <h2>{menu.kode_barang}</h2>
                            ))}
                          </Row>
                   </Col>
               <Hasil/>
         </Row>
         </Container>
      </div>
     </div>
    )
  }
}
